import { createMuiTheme } from '@material-ui/core/styles';
import red from '@material-ui/core/colors/red';

// Create a theme instance.
const theme = createMuiTheme({
  spacing: 8,
  type: "dark",
  palette: {
    primary: {
      main: '#556cd6',
    },
    secondary: {
      main: '#56A296',
    },
    error: {
      main: red.A400,
    },
    textSecondary: {
      main: '#000'
    },
    green: {
      main: '#a5f0d2',
      dark: '#4c7c69'
    },
  },
  typography: {
    fontFamily: [
      'PT Serif',
      'Serif'
    ],
    h1: {

    },
    h2: {

    },
    h3: {

    },
    h3: {

    },
    h5: {
      fontFamily: "Raleway",
      fontSize: 14,
      fontWeight: "500",
    },
    button: {
      fontFamily: "Raleway",
      textTransform: "none"
    },
    body1: {
      fontSize: 16,
      fontFamily: "PT Serif"
    },
    p2: {

    }
  }
});

export default theme;
